  [],\n\t\"revision_timestamp\": \"2015-05-07T03:41:51.703259\",\n\t\"name\": \"eulerian-air-traffic-flow-management-agent-for-the-aces-software-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The development of an Eulerian model based
  en route traffic flow management agent for the ACES software is proposed. The proposed
  research will use a recently-developed automatic modeling technique, together with
  a predictive air traffic flow control approach. Performance of the traffic flow
  management agent will be evaluated in several traffic flow control situations. The
  sensitivity of the traffic flow management system to variations in traffic patterns
  and weather will be investigated.rnrnPhase I research will demonstrate the feasibility
  of developing the traffic flow management agent.  A complete version of the proposed
  software agent will be developed during the Phase II work. It will be fully integrated
  with the ACES software and commercialized during the Phase III work.rn\",\n\t\"license_title\":
